import React from 'react';
import { app, database } from './firebase'; // Import app and database from your Firebase configuration file

import { ref, set } from 'firebase/database';

const db = database;

const putData = () => {
  set(ref(db, 'users/Olwin'), {
    id: 1,
    name: "Olwin",
    age: "22",
  });
}

const App = () => {
  return (
    <div>
      App
      <button onClick={putData}>Putdata</button>
    </div>
  )
}

export default App;
